result:
.routeinstall{
  width: 100%;
  height: calc(100vh - 80px);
  background: #f0f3ff;
  overflow: hidden;
}
.map{
  width: 100%;
  height: 100%;
}
.leftdiv{
  width: 250px;
  height: 100%;
  position: absolute;
  background: #fff;
  z-index: 1;
}
.leftdiv .list{
  width: 30%;
  height: 3vh;
  margin-left: 1.5%;
  background:rgba(232,237,255,1);
  border-radius:10px;
  font-family:PingFang SC;
  font-weight:500;
  color:rgba(63,106,255,1);
  text-align: center;
  font-size: 10px;
  line-height: 3vh;
  float: left;
  margin-top: 10px;
  cursor:pointer;
}
.xin{
  width: 100%;
  height: 15vh;
  overflow: hidden;
  position: absolute;
  bottom: 0;
  left: 0;
}
.xin .header{
  width: 100%;
  border-left: 5px solid rgba(63,106,255,1);
  padding-left: 10px;
  margin-bottom: 2%;
}
.xin .tabs{
  font-size: 1vh;
  background: rgba(232,237,255,0.7);
  /* background: #f1f4ff; */
  height: 10vh;
  width: 95%;
  color: #ffffff;
  border-radius: 1vh;
  /* margin: auto; */
  padding: 1%;
}
.leftdiv .zhong {
  background: #3F6AFF;
  color: #fff;
}
.icon{
  height: 70%;
  margin-top: 4%;
  margin-left: 10%;
  float: left;
}
